import React from "react";
import styled from "styled-components";
import {
  Container,
  SubHeader,
  SubText,
  Text,
  CaptionText,
} from "../../styledComponents";
import { Avatar, Divider } from "@material-ui/core";
import MailIcon from "@material-ui/icons/Mail";
import BathroomIcon from "@material-ui/icons/BathTub";
import BedIcon from "@material-ui/icons/KingBed";
import GardenIcon from "@material-ui/icons/AmpStories";
import CarIcon from "@material-ui/icons/DirectionsCar";
import GraphIcon from "@material-ui/icons/ShowChart";
import ViewIcon from "@material-ui/icons/Style";

const Tag = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  border-radius: 20px;
  background-color: #e1e1e1;
  padding: 4px 15px;
  margin: 0px 5px;
`;

const ProfileTab = () => {
  return (
    <Container flex={1} column customStyles={{ paddingTop: 30 }}>
      <Container
        color="white"
        flex={0}
        row
        customStyles={{ padding: 20, borderRadius: 4 }}
      >
        <Container middle center flex={0.1}>
          icon
        </Container>
        <Container column middle flex={0.7} color="green">
          {" "}
          status
        </Container>
        <Container middle center flex={0.2} color="red">
          active
        </Container>
      </Container>
    </Container>
  );
};

export default ProfileTab;
